import React from 'react';
import './index.css';
 
const Todo = (props) => {
    return(
        <>
        <div className="todo-style">
            <i class="fa fa-times" aria-hidden="true"></i>
            <li>{props.value}</li>
        </div>
        </>
    );
};

export default Todo;
